{
  "$schema": "../node_modules/@tauri-apps/cli/config.schema.json",
  "productName": "Everything",
  "version": "0.2.0",
  "identifier": "com.everything.app",
  "build": {
    "beforeDevCommand": "npm run dev",
    "devUrl": "http://localhost:1420",
    "beforeBuildCommand": "npm run build",
    "frontendDist": "../dist"
  },
  "app": {
    "macOSPrivateApi": true,
    "windows": [
      {
        "title": "Everything",
        "label": "main",
        "width": 600,
        "height": 380,
        "transparent": true,
        "resizable": true,
        "fullscreen": false
      }
    ],
    "security": {
      "csp": null
    }
  },
  "bundle": {
    "active": true,
    "targets": "dmg",
    "category": "DeveloperTool",
    "icon": [
      "icons/32x32.png",
      "icons/128x128.png",
      "icons/icon.png",
      "icons/icon.icns"
    ],
    "resources": {
      "../everything.icon": "everything.icon"
    },
    "macOS": {
      "signingIdentity": null,
      "entitlements": "Entitlements.plist",
      "minimumSystemVersion": "11.0",
      "infoPlist": "Info.plist"
    }
  }
}
